import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import imgca1 from '../assets/khungcanh.jpeg';
import imgca2 from '../assets/baber.jpeg';
import imgca3 from '../assets/place.jpeg';
import 'bootstrap/dist/css/bootstrap.css';
import '../srccss/Home.css';
import Slider from "react-slick";
import 'slick-carousel/slick/slick.css'; 
import 'slick-carousel/slick/slick-theme.css';
import {Best_hair_dresser} from './data/data';




export default function Homepage() {
    const settings = {
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
      };
  return (
    <div div className='main-content'>
    <div className='carousel'>
    <Carousel>
    <Carousel.Item>
      <img
        className="d-block w-100 h-2 imgca1"
        src={imgca1} 
        alt="First slide"
      />
      <Carousel.Caption>
        <h3 className='first-slide'>First slide label</h3>
        <p className='first-slide'>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
      </Carousel.Caption>
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="d-block w-100 imgca2"
        src={imgca2}
        alt="Second slide"
      />

      <Carousel.Caption>
        <h3 className='second-slide'>Second slide label</h3>
        <p className='second-slide'>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
      </Carousel.Caption>
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="d-block w-100 imgca3"
        src={imgca3}
        alt="Third slide"
      />

      <Carousel.Caption>
        <h3>Third slide label</h3>
        <p>
          Praesent commodo cursus magna, vel scelerisque nisl consectetur.
        </p>
      </Carousel.Caption>
    </Carousel.Item>
  </Carousel>
    </div>

    <div className='Best_hair_dresser'>
    <h1>Best hair dresser</h1>
    <Slider {...settings }>
    {Best_hair_dresser.map((item)=>(
        <div className='card'>
        <div className='card-top'>
          <img src={item.Img} alt={item.title}/>
          <span className='name1'>{item.name}</span>
          <p>{item.title}</p>
          </div>
        </div>
       ))}
    </Slider>
    </div>
    </div>

  )
}
